## Create Dataset
This endpoint allows you to create a new dataset under a specific account.

### Request
- Method: POST
- URL: `{{nasUrl}}/accounts/{{accountId}}/datasets`
- Headers: 
    - Content-Type: application/json
- Body:
    ```json
    {
        "data": {
            "type": "",
            "attributes": {
                "name": "",
                "Country": "",
                "externalId": "",
                "externalSource": ""
            }
        }
    }
    ```

### Response
- Status: 201
- Content-Type: application/json
- Body:
    ```json
    {
        "value": {
            "data": {
                "type": "",
                "id": ""
            }
        },
        "statusCode": 0
    }
    ```

### Example Response
```json
{
    "data": {
        "type": "",
        "id": ""
    }
}
```

### Create a variable
- Variable Name: `tenantId`
- Value: `id`

# Get Dataset Details

This endpoint retrieves details for a specific dataset by making an HTTP GET request to the specified URL.

### Request Parameters

- `DatasetId` (string): The unique identifier of the dataset.

- `nasUrl` (string): The base URL for the NAS.


### Response

The response will have a status code of 403 and a content type of text/xml. The response body will contain details of the dataset including its type, id, account relationship, and metadata such as creation and modification timestamps.

### Example Response

```
{
    "data": {
        "type": "",
        "id": "",
        "relationship": {
            "account": {
                "links": {
                    "related": ""
                },
                "data": {
                    "type": "",
                    "id": ""
                }
            }
        },
        "meta": {
            "createdAt": "",
            "createdSource": "",
            "modifiedAt": "",
            "modifiedSource": ""
        }
    }
}

 ```

### Pre-request Script

To log a message if the variables `DatasetId` and `nasUrl` are null or empty, the following pre-request script can be used:

``` javascript
if (!pm.variables.get("DatasetId") || !pm.variables.get("nasUrl")) {
    console.log("DatasetId or nasUrl is null or empty");
}

 ```

